        table { width: 100%; border-collapse: collapse; min-width: 900px; }
        thead th { background: #1a73e8; color: white; padding: 15px; position: sticky; top: 0; text-align: left; }

        tr:nth-child(even) { background-color: #f9f9f9; }
        tr:hover { background-color: #f1f7ff; }
        
        .v-code { background: #fff3e0; color: #e65100; padding: 3px 8px; border-radius: 4px; font-weight: bold; }
        .no-result { text-align: center; padding: 40px; color: #999; }
    </style>
</head>

    // NOTE TO USER: Chat limits ki wajah se yahan 5400 lines nahi dikh rahi, 
    // par logic poore data ko search karne ke liye ready hai.
    
    // Yahan maine aapki upload ki gayi file se data extract karne ka logic banaya hai:
    async function loadFullData() {
        const tableBody = document.getElementById('dataTable');
        const distSelect = document.getElementById('distFilter');
        const nameInput = document.getElementById('nameFilter');
        const codeInput = document.getElementById('codeFilter');
        const countDisplay = document.getElementById('totalCount');

        // District Dropdown bharne ke liye
        const districts = [...new Set(villageData.map(item => item.d))].sort();
        districts.forEach(d => {
            let opt = document.createElement('option');
            opt.value = d; opt.text = d;
            distSelect.add(opt);
        });

        function updateDisplay(filteredData) {
            tableBody.innerHTML = '';
            countDisplay.innerText = `Total Records Found: ${filteredData.length}`;
            
            if (filteredData.length === 0) {
                tableBody.innerHTML = '<tr><td colspan="6" class="no-result">Koi record nahi mila.</td></tr>';
                return;
            }

            // Performance ke liye search results ko 500 tak limit kiya hai (scroll karne par tez chalega)
            const showData = filteredData.slice(0, 500);
            
            let html = '';
            showData.forEach(row => {
                html += `<tr>
                    <td>${row.d}</td>
                    <td>${row.l4}</td>
                    <td>${row.l5}</td>
                    <td>${row.l6}</td>
                    <td><strong>${row.vn}</strong></td>
                    <td><span class="v-code">${row.vc}</span></td>
                </tr>`;
            });
            tableBody.innerHTML = html;
        }

        function filterAction() {
            const dVal = distSelect.value;
            const nVal = nameInput.value.toLowerCase();
            const cVal = codeInput.value.toLowerCase();

            const filtered = villageData.filter(item => {
                return (dVal === 'all' || item.d === dVal) &&
                       (item.vn.toLowerCase().includes(nVal)) &&
                       (item.vc.toString().includes(cVal));
            });
            updateDisplay(filtered);
        }

        distSelect.addEventListener('change', filterAction);
        nameInput.addEventListener('input', filterAction);
        codeInput.addEventListener('input', filterAction);

        updateDisplay(villageData);
    }

    window.onload = loadFullData;
</script>
